import React from 'react';
import './Logo.css';
import Media from 'react-media';
import { TweenMax, Expo } from 'gsap';

// Return logo view
export default function REturnLogo() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => {
 return (
  <div className='wrp-logo-reset'>
   <ViewLogo />
  </div>
 )
};
export const ScreenSmall = () => {
 return (
  <div className='wrp-logo-reset-sm'>
   <ViewLogo />
  </div>
 );
};
export const ViewLogo = () => {

 React.useEffect(() => {
  TweenMax.from('.Anima-Reset', 1.2, { delay: 1.6, opacity: 0, y: 20, ease: Expo.easeIn });

 }, []);

 return (
  <img src={'/img/logo.png'} alt={'logo view '} className='Anima-Reset' />
 );
};
